import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';



const useStyles = makeStyles({
    root: {
      maxWidth: 345,
    },
    media: {
      height: 200,
    },
  });

  


export default function Cardu(props) {
    const classes = useStyles();
    return (
        <>
        <Grid item xs={12} md={4}>
       <div style={{width:'100%',height:'100%'}}>
            <img src={props.img} width='100%' height='300px'></img>
       <div style={{width: '80%', height: '80px' , backgroundColor:"white",position:"relative",bottom: '40px',left:'30px',boxShadow:' 0 20px 40px rgb(0 0 0 / 6%)'}}>
       <p style={{color:"#CDBA6D",fontSize:"1.6rem",padding:"12px 0 0 15px"}} className="linky"><b>Personal</b></p>
       <h1></h1>
       </div>
       </div>
       </Grid>
        
        </>
    )
}
